		"Created": "Fri, 27 Jan 2023 21:40:00 GMT",
		"ArticleTitle": "Fed policy to align bank oversight could limit crypto activities by state banks",
		"ProviderLogo": "https://s3.tradingview.com/news/logo/cointelegraph-en--theme-light.svg",
		"ProviderUrl": "https://cointelegraph.com",
		"ArticleContent": "<div class=\"body-jEK_kEtx body-op4L5uvo content-op4L5uvo\"><span><p class=\"\">The United States Federal Reserve Board announced Jan. 27 that it was issuing a policy statement on limitations on banks. The policy seeks to create a level playing field and limit regulatory arbitrage for state banks with deposit insurance, state banks without deposit insurance and national banks, which are overseen by the Office of the Comptroller of the Currency (OCC), by allowing them the same scope of permissible activities.</p><p class=\"\">The new policy will limit the activities of state banks by not allowing them to engage in activities not permitted by national banks unless state legislation allows it. In the Federal Register notice, the statement specifically discusses crypto at length. It stated:</p><div class=\"blockquote-R3wFjtCA\">“The Board has not identified any authority permitting national banks to hold most crypto-assets [...] As principal in any amount, and there is no federal statute or rule expressly permitting state banks to hold crypto-assets as principal. Therefore, the Board would presumptively prohibit state member banks from engaging in such activity under section 9(13) of the [Federal Reserve] Act.” </div><p class=\"\">The notice also said that state banks have proposed issuing “dollar tokens” — that is, stablecoins — and those banks now will be subject to OCC interpretative letters 1174 and 1179, as are national banks. It added:</p><div class=\"blockquote-R3wFjtCA\">“The Board generally believes that issuing tokens on open, public, and/or decentralized networks, or similar systems is highly likely to be inconsistent with safe and sound banking practices.” </div><p class=\"\">The statement was issued on the same day that the Fed rejected the application of Wyoming’s Custodia Bank for Federal Reserve System membership.</p><p class=\"\">The Fed beefed up scrutiny on banks engaging in crypto activities in August 2022, when it issued a letter requiring the banks it oversees to disclose plans that include crypto, with a reminder to ensure adequate risk management. The letter applied retrospectively to banks already active in crypto.</p><div class=\"container-Oc7Vf5KC\"><blockquote class=\"blockquote-Oc7Vf5KC\"><div class=\"header-Oc7Vf5KC\"><span class=\"profile-Oc7Vf5KC\"><div class=\"avatar-Oc7Vf5KC\"></div><div class=\"name-Oc7Vf5KC\">Federal Reserve</div><div class=\"username-Oc7Vf5KC\">@federalreserve</div></span><span class=\"logo-Oc7Vf5KC\"><svg height=\"28\" viewbox=\"0 0 28 28\" width=\"28\" xmlns=\"http://www.w3.org/2000/svg\"><path d=\"M10.28 22.26c7.55 0 11.68-6.26 11.68-11.67v-.53c.8-.58 1.49-1.3 2.04-2.13-.74.33-1.53.54-2.36.65.85-.5 1.5-1.32 1.8-2.28-.78.48-1.66.81-2.6 1a4.1 4.1 0 00-7 3.74c-3.4-.17-6.43-1.8-8.46-4.29a4.1 4.1 0 001.28 5.48c-.68-.02-1.3-.2-1.86-.5v.05a4.11 4.11 0 003.29 4.02 4 4 0 01-1.85.08 4.1 4.1 0 003.83 2.85A8.23 8.23 0 014 20.43a11.67 11.67 0 006.28 1.83z\" fill=\"#1DA1F2\"></path></svg></span></div><div class=\"description-Oc7Vf5KC\"><p class=\"\">@federalreserve issues policy statement to promote a level playing field for all banks with a federal supervisor, regardless of deposit insurance status: https://t.co/ms40zhoYUY</p></div><span class=\"date-Oc7Vf5KC\">Jan 27, 2023</span><span class=\"border-Oc7Vf5KC\"></span><span class=\"socials-Oc7Vf5KC\"></span><a href=\"https://twitter.com/federalreserve/status/1619010218876362755\"></a></blockquote><div></div></div></span></div>",
