		"ArticleTitle": "Will loan origination growth help SoFi Technologies' Q4 earnings top estimates?",
		"ProviderLogo": "https://s3.tradingview.com/news/logo/seeking-alpha--theme-light.svg",
		"ProviderUrl": "https://seekingalpha.com/?utm_medium=referral&utm_source=tradingview",
		"ArticleContent": "<div class=\"body-jEK_kEtx body-op4L5uvo content-op4L5uvo\"><span><ul class=\"list-nctczWnN list--padded-nctczWnN\"><li class=\"listItem-nctczWnN\">SoFi Technologies (NASDAQ:SOFI) is scheduled to announce Q4 earnings results on Monday, January 30, before market open.</li><li class=\"listItem-nctczWnN\">The consensus EPS estimate is -$0.07 and the consensus revenue estimate is $425.53M (+52% Y/Y).</li><li class=\"listItem-nctczWnN\">Over the last 3 months, EPS estimates have seen 2 upward revisions and 1 downward. Revenue estimates have seen 3 upward revisions and 5 downward.</li><li class=\"listItem-nctczWnN\">The neobanking company's student loan refinancing business has been under pressure owing to the moratorium on student loan payments, which is in place till August.</li><li class=\"listItem-nctczWnN\">However, Mizuho expects the latest extension to be \"less dramatic\" than the one in April due to an already lower expectation for refinancing in the current high-rate environment.</li><li class=\"listItem-nctczWnN\">Oppenheimer said SoFi's (SOFI) personal loan origination growth helped it in \"navigating/plugging the revenue gap of the moratorium this far\". Guidance will likely exclude any ramp in student loan originations this year <a href=\"https://seekingalpha.com/news/3911114-latest-student-loan-pause-should-have-smaller-effect-on-sofi-than-aprils-mizuho?utm_medium=referral&amp;utm_source=tradingview\" rel=\"nofollow noopener noreferrer\" target=\"_blank\">back to 2019 levels</a>.</li><li class=\"listItem-nctczWnN\">In November, SoFi (SOFI) stock suffered selling pressure after some U.S. senators <a href=\"https://seekingalpha.com/news/3910153-sofi-stock-slides-after-lawmakers-urge-review-of-its-crypto-trading-activities?utm_medium=referral&amp;utm_source=tradingview\" rel=\"nofollow noopener noreferrer\" target=\"_blank\">urged regulators </a>to take a closer look at the fintech's cryptocurrency-related business. Morgan Stanley said this increased the odds that SoFi (SOFI) will <a href=\"https://seekingalpha.com/news/3910652-sofi-stock-still-under-pressure-as-odds-of-regulator-scrutiny-rises-analyst-says?utm_medium=referral&amp;utm_source=tradingview\" rel=\"nofollow noopener noreferrer\" target=\"_blank\">exit crypto entirely</a>.</li><li class=\"listItem-nctczWnN\">SoFi (SOFI) stock surged after the company posted <a href=\"https://seekingalpha.com/news/3898405-sofi-technologies-stock-climbs-after-record-q3-revenue-adjusted-ebitda?utm_medium=referral&amp;utm_source=tradingview\" rel=\"nofollow noopener noreferrer\" target=\"_blank\">record Q3 results</a> and boosted its guidance for the year.</li><li class=\"listItem-nctczWnN\">Read why SA contributor Christopher Hoeger expects SoFi (SOFI) to continue to <a href=\"https://seekingalpha.com/article/4571414-sofi-q4-earnings-preview-kpis-and-key-metrics?utm_medium=referral&amp;utm_source=tradingview\" rel=\"nofollow noopener noreferrer\" target=\"_blank\">weather macro headwinds</a>.</li></ul></span></div>",
