		"Created": "Fri, 27 Jan 2023 21:18:35 GMT",
		"ArticleTitle": "Aave deploys V3 on Ethereum after 10 months of testing on other networks",
		"ProviderLogo": "https://s3.tradingview.com/news/logo/cointelegraph-en--theme-light.svg",
		"ProviderUrl": "https://cointelegraph.com",
		"ArticleContent": "<div class=\"body-jEK_kEtx body-op4L5uvo content-op4L5uvo\"><span><p class=\"\">The third version of crypto lending app Aave has now been deployed to Ethereum for the first time, according to a Jan. 27 tweet thread from the Aave team. “Aave V3” was originally released in March 2022, and it was deployed on multiple Ethereum Virtual Machine (EVM)-compatible blockchains shortly afterward. Until now, Ethereum users only had access to the app's older “V2” version.</p><div class=\"container-Oc7Vf5KC\"><blockquote class=\"blockquote-Oc7Vf5KC\"><div class=\"header-Oc7Vf5KC\"><span class=\"profile-Oc7Vf5KC\"><div class=\"avatar-Oc7Vf5KC\"></div><div class=\"name-Oc7Vf5KC\">Aave</div><div class=\"username-Oc7Vf5KC\">@AaveAave</div></span><span class=\"logo-Oc7Vf5KC\"><svg height=\"28\" viewbox=\"0 0 28 28\" width=\"28\" xmlns=\"http://www.w3.org/2000/svg\"><path d=\"M10.28 22.26c7.55 0 11.68-6.26 11.68-11.67v-.53c.8-.58 1.49-1.3 2.04-2.13-.74.33-1.53.54-2.36.65.85-.5 1.5-1.32 1.8-2.28-.78.48-1.66.81-2.6 1a4.1 4.1 0 00-7 3.74c-3.4-.17-6.43-1.8-8.46-4.29a4.1 4.1 0 001.28 5.48c-.68-.02-1.3-.2-1.86-.5v.05a4.11 4.11 0 003.29 4.02 4 4 0 01-1.85.08 4.1 4.1 0 003.83 2.85A8.23 8.23 0 014 20.43a11.67 11.67 0 006.28 1.83z\" fill=\"#1DA1F2\"></path></svg></span></div><div class=\"description-Oc7Vf5KC\"><p class=\"\">Aave Protocol V3 is now live on the Ethereum market </p><p class=\"\">”The most exciting aspect of V3 is its flexible design, which enables a variety of new risk mitigation features, and its improved capital efficiency &amp; decentralized liquidity – all while reducing gas costs.” @StaniKulechov pic.twitter.com/QsSnnlhEMr</p></div><span class=\"date-Oc7Vf5KC\">Jan 27, 2023</span><span class=\"border-Oc7Vf5KC\"></span><span class=\"socials-Oc7Vf5KC\"></span><a href=\"https://twitter.com/AaveAave/status/1618903037761945601\"></a></blockquote><div></div></div><p class=\"\">Aave V3 includes several features intended to help users save on fees and maximize the efficiency of users’ capital. For example, High Efficiency mode allows the borrower to avoid some of the app’s more stringent risk parameters if the borrower’s collateral is highly correlated with the asset being borrowed. Developers say this may be useful for borrowers of stablecoins or liquid staking derivatives. </p><p class=\"\">In addition, the “isolation” feature allows certain, riskier assets to be used as collateral as long as they have their own debt ceiling and are only used to borrow stablecoins. Under the previous version, there was no way to limit what type of asset could be borrowed given a certain type of collateral. This meant that lower market-cap and illiquid coins often couldn’t be used as collateral.</p><p class=\"\">V3 also includes a gas optimization algorithm that the developers say will reduce gas fees by 20% to 25%.</p><p class=\"\">The code for V3 was published back in November 2021. In March 2022, the Aave DAO approved an initial vote to deploy the new version. Over the next few months, V3 was deployed to Avalanche (AVAX), Arbitrum (ARB), Optimism (OP) and Polygon (MATIC). However, the Ethereum version of Aave has always had the most liquid and V3 was not available on it previously.</p><p class=\"\">According to the official proposal, the initial launch only has seven coins. The vote to launch began on Jan. 23 and lasted for two days. After supporters won the vote, the execution of the proposal was able to move forward on Jan. 27. Less than 0.01% of DAO members voted against the proposal.</p><p class=\"\">In November 2022, Aave changed its governance procedures after it was hit by a $60 million short attack that ultimately failed.</p></span></div>",
