		"ArticleTitle": "New Ripple president says her job is to continue to scale amid crypto winter",
		"ProviderLogo": "https://s3.tradingview.com/news/logo/cointelegraph-en--theme-light.svg",
		"ProviderUrl": "https://cointelegraph.com",
		"ArticleContent": "<div class=\"body-jEK_kEtx body-op4L5uvo content-op4L5uvo\"><span><p class=\"\">Monica Long has been named the new president of Ripple, moving up from general manager. Long joined the company in 2013 as director of communications and expanded her role last year from general manager of RippleX, the blockchain development side of the business, to general manager of the company as a whole, adding RippleNet, the company’s financial network, to her purview.</p><p class=\"\">The presidency of Ripple has been a somewhat nebulous position until now, with the title being ascribed to both co-founders Brad Garlinghouse and Chris Larsen at various times.</p><p class=\"\">Long’s promotion comes at a good moment for the company. She told Cointelegraph: </p><div class=\"blockquote-R3wFjtCA\">“It’s a job of continuing to scale. […] We’ve weathered many [crypto] winters, and with this one, we’re coming off a record year of business and customer growth.”</div><p class=\"\">In this environment, “We’re continuing to grow our team,” she added.</p><div class=\"container-Oc7Vf5KC\"><blockquote class=\"blockquote-Oc7Vf5KC\"><div class=\"header-Oc7Vf5KC\"><span class=\"profile-Oc7Vf5KC\"><div class=\"avatar-Oc7Vf5KC\"></div><div class=\"name-Oc7Vf5KC\">Monica Long</div><div class=\"username-Oc7Vf5KC\">@MonicaLongSF</div></span><span class=\"logo-Oc7Vf5KC\"><svg height=\"28\" viewbox=\"0 0 28 28\" width=\"28\" xmlns=\"http://www.w3.org/2000/svg\"><path d=\"M10.28 22.26c7.55 0 11.68-6.26 11.68-11.67v-.53c.8-.58 1.49-1.3 2.04-2.13-.74.33-1.53.54-2.36.65.85-.5 1.5-1.32 1.8-2.28-.78.48-1.66.81-2.6 1a4.1 4.1 0 00-7 3.74c-3.4-.17-6.43-1.8-8.46-4.29a4.1 4.1 0 001.28 5.48c-.68-.02-1.3-.2-1.86-.5v.05a4.11 4.11 0 003.29 4.02 4 4 0 01-1.85.08 4.1 4.1 0 003.83 2.85A8.23 8.23 0 014 20.43a11.67 11.67 0 006.28 1.83z\" fill=\"#1DA1F2\"></path></svg></span></div><div class=\"description-Oc7Vf5KC\"><p class=\"\">Over half my professional career has been in crypto – and more importantly, at @Ripple. I’m incredibly honored and ready to hit the ground running as President. Thank you @bgarlinghouse and @chrislarsensf for the opportunity of a lifetime! https://t.co/7gXZJZwLNN</p></div><span class=\"date-Oc7Vf5KC\">Jan 27, 2023</span><span class=\"border-Oc7Vf5KC\"></span><span class=\"socials-Oc7Vf5KC\"></span><a href=\"https://twitter.com/MonicaLongSF/status/1618997124653518848\"></a></blockquote><div></div></div><p class=\"\">Long joined Ripple when the company had only 10 employees. She spearheaded the development of the company’s On-Demand Liquidity solution, described as “Ripple’s flagship product,” which was launched in 2018. Ripple added an adjacent service called LiquidityHub last year, and the company will continue to expand that service, Long said. Over 60% of RippleNet’s payment volume was sent through ODL last year.</p><p class=\"\">On the RippleX side, Long said an automatic market maker specification would go up for a vote by the validators this year. </p><p class=\"\">Ripple is often in the news due to its ongoing court case with the United States Securities and Exchange Commission. The SEC has accused Ripple and co-founders Garlinghouse and Larsen of conducting an unregistered securities offering of $1.38 billion and selling XRP (<a href=\"https://www.tradingview.com/symbols/XRPUSD/\" rel=\"nofollow noopener noreferrer\" target=\"_blank\">XRP</a>) to retail investors as an unregistered security.</p><p class=\"\">Garlinghouse told CNBC on Jan. 18 that the company expects a decision on the case this year.</p></span></div>",
