		"ProviderLogo": "https://s3.tradingview.com/news/logo/cointelegraph-en--theme-light.svg",
		"ProviderUrl": "https://cointelegraph.com",
		"ArticleContent": "<div class=\"body-jEK_kEtx body-op4L5uvo content-op4L5uvo\"><span><p class=\"\">A bill introduced to the New York State Assembly on Jan. 26 would allow state agencies to accept cryptocurrency as a form of payment for fines, civil penalties, taxes, fees and other payments charged by the state.</p><div class=\"container-Oc7Vf5KC\"><blockquote class=\"blockquote-Oc7Vf5KC\"><div class=\"header-Oc7Vf5KC\"><span class=\"profile-Oc7Vf5KC\"><div class=\"avatar-Oc7Vf5KC\"></div><div class=\"name-Oc7Vf5KC\">Interpret Crypto</div><div class=\"username-Oc7Vf5KC\">@interpretcrypto</div></span><span class=\"logo-Oc7Vf5KC\"><svg height=\"28\" viewbox=\"0 0 28 28\" width=\"28\" xmlns=\"http://www.w3.org/2000/svg\"><path d=\"M10.28 22.26c7.55 0 11.68-6.26 11.68-11.67v-.53c.8-.58 1.49-1.3 2.04-2.13-.74.33-1.53.54-2.36.65.85-.5 1.5-1.32 1.8-2.28-.78.48-1.66.81-2.6 1a4.1 4.1 0 00-7 3.74c-3.4-.17-6.43-1.8-8.46-4.29a4.1 4.1 0 001.28 5.48c-.68-.02-1.3-.2-1.86-.5v.05a4.11 4.11 0 003.29 4.02 4 4 0 01-1.85.08 4.1 4.1 0 003.83 2.85A8.23 8.23 0 014 20.43a11.67 11.67 0 006.28 1.83z\" fill=\"#1DA1F2\"></path></svg></span></div><div class=\"description-Oc7Vf5KC\"><p class=\"\">JUST IN: A New York Senate has introduced a bill to allow #Crypto as a form of payment </p></div><span class=\"date-Oc7Vf5KC\">Jan 27, 2023</span><span class=\"border-Oc7Vf5KC\"></span><span class=\"socials-Oc7Vf5KC\"></span><a href=\"https://twitter.com/interpretcrypto/status/1618998920641933314\"></a></blockquote><div></div></div><p class=\"\">New York State Assembly Bill A523 was introduced by Democratic Assembly Member Clyde Vanel, who is often seen as a crypto-friendly politician. It allows state agencies to enter into “agreements with persons to provide the acceptance, by offices of the state, of cryptocurrency as a means of payment” for various types of fees, including “fines, civil penalties, rent, rates, taxes, fees, charges, revenue, financial obligations or other amounts, including penalties, special assessments and interest, owed to state agencies.” </p><p class=\"\">The bill does not obligate state agencies to accept crypto as payment, but it does clarify that state agencies can legally agree to accept such payments and that these agreements should be enforced by the courts.</p><p class=\"\">The bill defines “cryptocurrency” as “any form of digital currency in which encryption techniques are used to regulate the generation of units of currency [...] including but not limited to, bitcoin, ethereum, litecoin and bitcoin cash.”</p><p class=\"\">Depending on how this definition is interpreted, it may or may not include stablecoins like USD Coin (<a href=\"https://www.tradingview.com/symbols/USDCUSD/\" rel=\"nofollow noopener noreferrer\" target=\"_blank\">USDC</a>) and Tether (<a href=\"https://www.tradingview.com/symbols/USDTUSD/\" rel=\"nofollow noopener noreferrer\" target=\"_blank\">USDT</a>). On the one hand, the supply of stablecoins is usually regulated by the issuer instead of by cryptography. On the other hand, the bill does recognize that some cryptocurrencies have an “issuer,” and it provides that agencies can charge the payor an extra fee if such a fee is charged by the cryptocurrency’s issuer.</p><p class=\"\">To become law, the bill will need to be passed by the New York Assembly and Senate, as well as signed into law by the state's Governor, Kathy Hochul.</p><p class=\"\">The New York state government is often seen as hostile to cryptocurrency. In November 2022, New York became the first state to pass a bill that banned nearly all cryptocurrency mining. It also has been criticized for the restrictive “BitLicense” it requires all crypto exchanges to acquire. In April 2022, the mayor of New York argued that the BitLicense law should be repealed.</p></span></div>",
