		"ArticleContent": "<div class=\"body-jEK_kEtx body-op4L5uvo content-op4L5uvo\"><div class=\"summary-op4L5uvo\"><div class=\"summaryTitle-op4L5uvo\">Key points:</div><span><ul class=\"list-nctczWnN\"><li class=\"listItem-nctczWnN listItem--lightning-nctczWnN\"><strong>Monero takes a delve into the red zone before scaling the heights, and reaching $181.</strong></li><li class=\"listItem-nctczWnN listItem--lightning-nctczWnN\"><strong>After rebounding on the 200-day MA, XMR fluctuates between the median upper BB bands.</strong></li><li class=\"listItem-nctczWnN listItem--lightning-nctczWnN\"><strong>RSI register lower lows and XMR could be in for fall. The 200-day MA could interject.</strong></li></ul></span></div><span><p class=\"\">Monero (XMR) has been on a roll when considering the seven day chart below. With an opening market price of $167, XMR took a short dive into the red zone before it began its triumphant march scaling the heights. During its quick dip into the red zone, Monero reached its lowest price of $165.36 on the first day.</p><p class=\"\">However, within a few hours, XMR reached its maximum price of $181.36 on the same day. Thereafter, the token traversed a rugged path with sudden drops and sudden spikes in price. Interestingly, all the spikes and drops hovered within the $172-$180 price range for the next four days of the week.</p> </span></div>",
