		"ArticleTitle": "Bitcoin will hit $200K before $70K ‘bear market’ next cycle — Forecast",
		"ProviderLogo": "https://s3.tradingview.com/news/logo/cointelegraph-en--theme-light.svg",
		"ProviderUrl": "https://cointelegraph.com",
		"ArticleContent": "<div class=\"body-jEK_kEtx body-op4L5uvo content-op4L5uvo\"><span><p class=\"\">Bitcoin (<a href=\"https://www.tradingview.com/symbols/BTCUSD/\" rel=\"nofollow noopener noreferrer\" target=\"_blank\">BTC</a>) has “well-formed” evidence, which suggests that its next all-time high will top out at $200,000, one analyst says.</p><p class=\"\">In a tweet on Jan. 27, popular Twitter commentator Trader Tardigrade, also known as Alan, also revealed $70,000 as the next potential bear market bottom.</p><p class=\"\"><strong>Stochastic indicator offers Bitcoin bulls historical firepower</strong></p><p class=\"\">For many, BTC price action is still bound by Bitcoin’s four-year halving cycles. The resulting price pattern offers one “all time high year” in every four, with 2025 next in line.</p><p class=\"\">Bitcoin’s block subsidy halving will occur a year prior, and from then on, Alan argues, the path will be open to a giant $200,000.</p><p class=\"\">That price tag came about from an analysis of Bitcoin’s stochastic oscillator, which syncs with cycle highs and lows in BTC/USD. Currently, the indicator is printing its latest trough, and if history is a guide, price behavior will do likewise.</p><p class=\"\">The stochastic oscillator is a volatility tool, which compares closing prices to historical averages.</p><p class=\"\">“Bitcoin well-formed structure with stochastic behavior indicates that the next ATH will be at 200K and next floor will be at 70K,” Alan summarized alongside an illustrative chart.</p><span class=\"container-Kl_TzTII\"><figure><div class=\"preview-xWiEHZgw fixedHeight-xWiEHZgw preview-Kl_TzTII\" style=\"max-height:600px;--news-image-aspect-ratio:0.6193921852387844\"><picture class=\"picture-xWiEHZgw\"><source src=\"https://s3.tradingview.com/news/image/cointelegraph:1c2ee9d7f094b-fce2a82835217bcc7bf6a5284f1c56fc-resized.webp\" type=\"images/webp\"/><img class=\"image-xWiEHZgw image-Kl_TzTII\" loading=\"lazy\" role=\"presentation\" src=\"https://s3.tradingview.com/news/image/cointelegraph:1c2ee9d7f094b-fce2a82835217bcc7bf6a5284f1c56fc-resized.jpeg\"/></picture></div><figcaption class=\"caption-Kl_TzTII\"><span class=\"copyright-Kl_TzTII\">Cointelegraph</span></figcaption></figure></span><p class=\"\">Responses to the post revealed a familiar divergence in opinions when it comes to Bitcoin’s future potential in U.S. dollar terms. </p><p class=\"\">Nonetheless, $200,000 may seem modest for some long-time market participants, that level being a mere 189% higher than the existing all-time high from November 2021.</p><p class=\"\">Consensus believes that the scope of BTC investment returns will diminish in percentage terms over time, with long-term volatility cooling each cycle.</p><p class=\"\"><strong>PlanB eyes $32,000 BTC price next</strong></p><p class=\"\">Equally optimistic in the current environment, meanwhile, is PlanB, the analyst responsible for the controversial Stock-to-Flow family of BTC price models. </p><p class=\"\">Bitcoin’s behavior in January has been a decisive turning point, he believes, pointing to various on-chain metrics as proof of the recovery.</p><p class=\"\">Among the latest is realized return, which tracks aggregate profitability of spent coins.</p><p class=\"\">“Realized return just popped positive! Sellers are now taking profit (green) instead of cutting losses (blue) .. big difference,” PlanB commented on a chart.</p><p class=\"\">PlanB added this week that Bitcoin’s next short-term target should be $32,000, also based on realized price data.</p><span class=\"container-Kl_TzTII\"><figure><div class=\"preview-xWiEHZgw fixedHeight-xWiEHZgw preview-Kl_TzTII\" style=\"max-height:600px;--news-image-aspect-ratio:0.5592105263157895\"><picture class=\"picture-xWiEHZgw\"><source src=\"https://s3.tradingview.com/news/image/cointelegraph:1c2ee9d7f094b-5139741fa6306f91a1b625d2a340f3f2-resized.webp\" type=\"images/webp\"/><img class=\"image-xWiEHZgw image-Kl_TzTII\" loading=\"lazy\" role=\"presentation\" src=\"https://s3.tradingview.com/news/image/cointelegraph:1c2ee9d7f094b-5139741fa6306f91a1b625d2a340f3f2-resized.jpeg\"/></picture></div><figcaption class=\"caption-Kl_TzTII\"><span class=\"copyright-Kl_TzTII\">Cointelegraph</span></figcaption></figure></span><p class=\"\">The views, thoughts and opinions expressed here are the authors’ alone and do not necessarily reflect or represent the views and opinions of Cointelegraph. </p></span></div>",
