		"Provider": "NewsBTC",
		"Created": "Fri, 27 Jan 2023 18:16:56 GMT",
		"ArticleTitle": "Bitcoin Exchange Outflows Reach Highest Value Since FTX Crash, Bullish?",
		"ProviderLogo": "https://s3.tradingview.com/news/logo/newsbtc--theme-light.svg",
		"ProviderUrl": "https://www.newsbtc.com",
		"ArticleContent": "<div class=\"body-jEK_kEtx body-op4L5uvo content-op4L5uvo\"><span><p class=\"\">On-chain data shows Bitcoin exchanges have registered the most significant outflows since the collapse of the crypto exchange FTX back in November.</p><p class=\"\">Related Reading: Bitcoin Investors Turn Greedy For First Time Since March 2022</p><p class=\"\"><strong>Bitcoin Exchange Netflow Shows Deep Negative Values</strong></p><p class=\"\">As an analyst in a CryptoQuant post pointed out, around 7,000 coins have left the exchange in this latest spike. The relevant indicator here is the “all exchanges netflow,” which measures the net amount of Bitcoin exiting or entering into the wallets of all centralized exchanges. The metric’s value is calculated by taking the difference between the inflows (the coins going in) and the outflows (the coins moving out).</p><p class=\"\">When the indicator has a positive value, the inflows overwhelm the outflows, and a net number of coins are deposited to exchanges. As one of the main reasons investors deposit to exchanges is for selling purposes, this trend can have bearish implications for the price of the crypto.</p><p class=\"\">On the other hand, negative values imply that a net amount of supply is currently being pulled off these platforms. Generally, holders withdraw their coins from exchanges to hold onto them for extended periods in personal wallets. Thus, such metric values can signal that investors are accumulating at the moment, which may have a bullish impact on the price.</p><p class=\"\">Now, here is a chart that shows the trend in the Bitcoin all exchange’s netflow over the last few months:</p><p class=\"\"><span class=\"container-Kl_TzTII\"><figure><div class=\"preview-xWiEHZgw fixedHeight-xWiEHZgw preview-Kl_TzTII\" style=\"max-height:600px;--news-image-aspect-ratio:0.54609375\"><picture class=\"picture-xWiEHZgw\"><source src=\"https://s3.tradingview.com/news/image/newsbtc:f792a663c094b-988e05f5f01eeaa5934f8698617cae43-resized.webp\" type=\"images/webp\"/><img alt=\"Bitcoin Exchange Netflow\" class=\"image-xWiEHZgw image-Kl_TzTII\" loading=\"lazy\" role=\"presentation\" src=\"https://s3.tradingview.com/news/image/newsbtc:f792a663c094b-988e05f5f01eeaa5934f8698617cae43-resized.jpeg\"/></picture></div><figcaption class=\"caption-Kl_TzTII\"><span class=\"copyright-Kl_TzTII\">NewsBTC</span></figcaption></figure></span></p><p class=\"\">As shown in the above graph, the Bitcoin exchange netflow recorded a deep negative spike during the past day. This outflow amounted to around 7,000 BTC, leaving the wallets of these platforms the largest value the metric has seen since the FTX crash back in November of last year.</p><p class=\"\">From the chart, it’s apparent that the aftermath of FTX’s collapse saw some substantial outflow values. The reason behind that is that a known exchange like FTX going belly up instilled fear among investors and made them more aware of the risks of keeping their coins in centralized platforms.</p><p class=\"\">Naturally, these holders fled exchanges in masses (causing the netflow to plunge into red values) so that they could store their Bitcoin in offsite wallets, the keys they own.</p><p class=\"\">Interestingly, the latest negative netflow spike was recorded while Bitcoin has been observing a sharp rally. Usually, inflows are more commonly seen in periods like now, as investors rush to take some profits.</p><p class=\"\">Thus, instead of making these large outflows, investors are showing signs that they are bullish on Bitcoin in the long term and feel that the current rally has more to offer still.</p><p class=\"\">That would be only if these investors made the withdrawals with accumulation in mind. In the scenario that they transferred out these coins for selling through over-the-counter (OTC) deals instead, Bitcoin could instead feel a bearish impulse.</p><p class=\"\"><strong>BTC Price</strong></p><p class=\"\">At the time of writing, Bitcoin is trading around $23,100, up 8% in the last week.</p></span></div>",
