		"ProviderUrl": "https://coinedition.com/",
		"ArticleContent": "<div class=\"body-jEK_kEtx body-op4L5uvo content-op4L5uvo\"><div class=\"summary-op4L5uvo\"><div class=\"summaryTitle-op4L5uvo\">Key points:</div><span><ul class=\"list-nctczWnN\"><li class=\"listItem-nctczWnN listItem--lightning-nctczWnN\"><strong>FBI infiltrates a ransomware gang to help 300 victims and thwarts extortion of over $130 million. </strong></li><li class=\"listItem-nctczWnN listItem--lightning-nctczWnN\"><strong>Hive Network targeted hospitals, schools, and banking in over 80 countries.</strong></li><li class=\"listItem-nctczWnN listItem--lightning-nctczWnN\"><strong>The FBI says the operation was coordinated with German and Dutch law enforcement.</strong></li></ul></span></div><span><p class=\"\">On Thursday, the Federal Bureau of Investigation (FBI) issued a statement announcing its success in seizing the ransomware group, Hive Network. The agency saved 300 victims, preventing them from paying $130 million in ransom demands.</p><p class=\"\">The statement read, “Since late July 2022, the FBI has penetrated Hive’s computer networks, captured its decryption keys and offered them to victims worldwide,” which allowed them to stop $130M in the ransom demand. The FBI was able to hack through attacks to gain 300 decryption keys for Hive victims under attack.</p><p class=\"\">Additionally, the agency gave 1,000 additional decryption keys to previous Hive victims. In coordination with German law enforcement and the Netherlands National High Tech Crime Unit, the department seized control of the servers and websites Hive used to communicate with its members, disrupting Hive’s ability to attack and extort victims. This was seen as a major victory for the agency.</p><p class=\"\"><strong>Christopher Wray, FBI Director, states:</strong></p><div class=\"blockquote-R3wFjtCA\"> <p class=\"\">The FBI w ... </p><p class=\"\">The post FBI Infiltrates Hive Network, Foils $130M in Ransom Demands appeared first on Coin Edition.</p></div></span></div>",
